import React from 'react';

const ImagesList = ({items})=>{
    return (
        <div className='imagelist'>
            {items.map((items , id)=>{
                return (
                    <ImagesList
                    key = {id}
                    image = {items.url}
                    />
                );
            })}
        </div>
    )
}

export default Images;
